				var aptg = arr;
				var rs = aptg.row | 0;
				var re = aptg.rowEnd | 0;
				var cs = aptg.col | 0;
				var ce = aptg.colEnd | 0;
				var sheet = aptg.sheet | 0;
				if( result.length != (re-rs+1) )
					return _g.error.value;
