		if (text === false) {
			text = 'FALSE';
		}
		if (isNaN(text) && typeof text === 'number') {
			return _g.error.value;
		}
		if (typeof text === 'number') {
			text = '' + text;
		}

		return text.replace(/\w\S*/g, function(txt) {
			return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();
		});
