"1_61_0":"A policy shall acquire lapse status if the policyholder fails to pay due premium within the grace period in the first three\/two policy years for Policy Term 20\/10 years as applicable. In such case, provided that at least one full year`s premium has been paid and the policy has not been revived: \n\n",
"1_62_0":"- An amount equal to Rs. 420000 is payable if 1 complete annualized premium (but less than 2) has been paid;",
"1_64_0":"The above amount is payable on a) death of the life assured, b) request for termination of the policy by the policyholder or c) expiry of the revival period, whichever happens earliest. ",
"1_66_0":"Notes:",
"1_67_0":"(1)  Maturity Benefit payable on survival of the Life Assured till the end  of the policy term is : Guaranteed Sum Assured at Maturity plus accrued annual bonuses (if any) plus final bonus (if any), Where, Guaranteed Sum Assured at Maturity is equal to Sum Assured. The Company has also illustrated above, returns projected at gross interest rates of 4% and 8%",
"1_69_0":"(2) The Death Benefit payable on death of Life Assured is:\n \"Higher of (Sum Assured chosen or 10 times of Annualised Premium) + Annual Bonuses added till date of death + Interim Bonus (if any) along with Final Bonus (if any at date of death)\nPlease note that the death benefit will be at least 105% of (all premiums paid less extra premiums paid, if any)\".",
"1_71_0":"On payment of death benefit, the policy will stand terminated.",
"1_73_5":"<<Page 3>>",
"1_74_0":"Notes:",
"1_75_0":"1. Some benefits are guaranteed and some benefits are variable with returns based on the future performance of your Insurer carrying on life insurance business. If your policy  \n    offers guaranteed returns then these will be clearly marked \u201Cguaranteed\u201D in the illustration table. If your policy offers variable returns then the illustrations on this \n    page will show two different rates of assumed future investment returns. These assumed rates of return are not guaranteed and they are not the upper or lower limits of what you \n    might get back, as the value of your policy is dependent on a number of factors including future investment performance.",
"1_78_0":"2. Annual bonuses and Final bonus (if any) are shown at an assumed investment rate of 4% or 8% every year in this illustration.There is no guarantee on the amount of  bonuses and these ",
"1_79_0":"    will be declared at the sole discretion of the company.",
"1_80_0":"3. This is a traditional plan intended for long term savings and benefits. It is strongly advised that the policy should be continued throughout the defined policy ",
"1_81_0":"    term to realise the full benefits. Early exit should not be opted for unless there is no other alternative available, as it will impact the policy value. If premiums are discontinued",
"1_82_0":"    after payment of at least 2 years\u2019 premium the policy will acquire a Paid-up value that you will receive on death or maturity, whichever is earlier, provided you have not surrendered or revived the policy.",
"1_83_0":"4. Your policy will acquire a guaranteed surrender value (GSV)after payment of at least 2 years\u2019 premium.However, the company may offer a special surrender value (SSV), and higher of {GSV or SSV} plus terminal\/interim bonus (if any) will be paid on surrender. ",
"1_84_0":"    The Illustration above only shows the guaranteed surrender value payable.",
"1_85_0":"5.  Premiums payable and benefits receivable under this plan are eligible for tax benefits as per the prevailing tax laws subject to amendments from time to time. ",
"1_86_0":"6.  The above premium is for a healthy individual. Your application will be assessed as per board approved underwriting policy of the company. Basis underwriting, it may result in an extra premium to be paid, which shall be borne by you.",
"1_87_0":"7. The above illustration takes into account currently applicable service tax & cess. However, the applicable taxes may change from time to time and total premium payable will change accordingly.",
"1_88_0":"8. The above illustration does not take into account rider Premium (if any).",
"1_91_0":"Risk Factors",
"1_92_0":"    There is no guarantee on the amount of bonuses and these will be declared at the sole discretion of the company. Hence, the bonuses in this plan may vary from time to time.",
